  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Tule Lake National
  Wildlife Refuge outlines Refuge accomplishments from January through April of 1955.
  The report begins by summarizing the weather conditions, water conditions, food
  and cover, and fires during this period. Wildlife- including migratory birds, upland
  game birds, big game animals, furbearers, predators, and rodents- is also covered.
  The Refuge development and maintenance section discusses physical developments,
  plantings, and collections and receipts. Resource management is discussed; topics
  include fur harvesting. The public relations section of the report describes Refuge
  visitors and Refuge participation. N-R forms, photographs, and narrative reports
  for Upper Klamath National Wildlife Refuge, Lower Klamath National Wildlife Refuge,
  and Clear Lake National Wildlife Refuge are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
